@import "@/assets/styles/sprite-home.scss";
.coinBuy {
  z-index: 100;
  // position: relative;
  .van-hairline--bottom:after {
    border: 0px;
    display: none;
  }
  .blue {
    width: 100%;
    height: 140px;
    background: var(--van-button-primary-background);
    margin-top: -2px;
    z-index: 5;
    position: relative;
    top: -1px;
  }
  .content {
    width: 100%;
    height: auto;
    background: #ebf1f6;
    padding: 0 21px;
    .amount {
      width: 708px;
      height: auto;
      background-color: #ffffff;
      border-radius: 14px;
      margin-top: -140px;
      position: relative;
      z-index: 6;
      padding-top: 84px;
      text-align: center;
      .NumText {
        font-family: MicrosoftYaHei;
        font-size: 26px;
        font-weight: normal;
        font-stretch: normal;
        line-height: 33px;
        letter-spacing: 0px;
        color: #787f8c;
        text-align: center;
      }
      h4 {
        margin-top: 35px;
        font-family: MicrosoftYaHei-Bold;
        font-size: 49px;
        font-weight: 600;
        font-stretch: normal;
        line-height: 33px;
        letter-spacing: 0px;
        color: #13161b;
        span {
          font-family: MicrosoftYaHei;
          font-size: 49px;
          font-weight: normal;
          font-stretch: normal;
          line-height: 33px;
          letter-spacing: 0px;
          color: #868d9a;
        }
      }
    }
    .sellNum {
      margin-top: 18px;
      width: 708px;
      height: auto;
      background-color: #ffffff;
      border-radius: 14px;
      font-size: 28px;
      padding: 19px;
      .numTitle {
        font-family: MicrosoftYaHei;
        font-size: 28px;
        font-weight: 400;
        font-stretch: normal;
        line-height: 33px;
        letter-spacing: 0px;
        color: #13161b;
        margin: 10px 0 25px;
      }
      :deep(.van-field) {
        margin-bottom: 15px;
        padding: 0 20px;
        height: 76px;
        background-color: #ebf1f6;
        border-radius: 7px;
        .van-field__control {
          line-height: 76px;
          font-family: MicrosoftYaHei;
          font-size: 35px;
          font-weight: normal;
          font-stretch: normal;
          letter-spacing: 0px;
          color: #13161b;
        }
        .van-field__button {
          font-family: MicrosoftYaHei;
          font-size: 26px;
          font-weight: normal;
          font-stretch: normal;
          line-height: 38px;
          letter-spacing: 0px;
          color: var(--van-button-primary-background);
        }
      }
      .caiText {
        padding: 15px 0;
        font-family: MicrosoftYaHei;
        font-size: 28px;
        font-weight: normal;
        font-stretch: normal;
        line-height: 33px;
        letter-spacing: 0px;
        color: #13161b;
      }
      :deep(.van-radio-group) {
        height: 40px;
        margin-bottom: 43px;
        .van-radio {
          margin-right: 5px;
        }
        .van-popover__wrapper {
          margin-right: 150px;
        }
        .van-radio__icon {
          width: 29px;
          height: 29px;
          background-color: #fff;
          border-radius: 15px;
          border: solid 5px var(--van-button-primary-background);
          .van-radio__icon--dot__icon {
            width: calc(100% - 5px);
            height: calc(100% - 5px);
          }
        }
        .van-radio__label {
          font-family: MicrosoftYaHei;
          font-size: 25px;
          font-weight: normal;
          font-stretch: normal;
          line-height: 40px;
          letter-spacing: 0px;
          color: #13161b;
        }
      }
      .payText {
        margin-top: 40px;
        font-family: MicrosoftYaHei;
        font-size: 28px;
        font-weight: 400;
        font-stretch: normal;
        line-height: 33px;
        letter-spacing: 0px;
        color: #13161b;
        margin-bottom: 45px;
      }
      .paypic {
        .payBox {
          .position_w {
            width: 100%;
            height: 100%;
            line-height: 106.9px;
            text-align: center;
            position: absolute;
            color: #fff;
            font-size: 33px;
            top: 0;
            left: 0;
            background-color: #797678;
            border-radius: 15.28px;
            opacity: 0.7;
            z-index: 5;
          }
          position: relative;
          // width: 205px;
          width: 156px;
          height: 106.9px;
          background-color: #ebf1f6;
          border-radius: 6.9px;

          //   margin: 0 auto;

          font-family: MicrosoftYaHei;
          font-size: 25px;
          font-weight: normal;
          font-stretch: normal;
          line-height: 30.3px;
          letter-spacing: 0px;
          color: #333333;
          text-align: center;
          :deep(.Spic) {
            width: 62.5px;
            height: 48.6px;
            margin: 10px auto;
            display: block;
          }
          .alipay {
            width: 52.5px;
            height: 52.5px;
          }
          .SZRMB {
            width: 52.5px;
            height: 52.5px;
          }
          .WeChatPay {
            margin: 10px auto 5.6px;
            width: 61.8px;
            height: 54.2px;
          }
          .hotPic {
            z-index: 10;
            position: absolute;
            top: -30px;
            left: 50%;
            transform: translateX(-50%);
            width: 92%;
            height: 35px;
            background: #f23b1d;
            border-radius: 18px;
            :deep(.icon_huo) {
              // height: 100%;
              img {
                width: auto;
                height: 20px;
                margin-top: -2px;
              }
              padding: 0 5px;
            }
            span {
              font-family: MicrosoftYaHei;
              font-size: 19px;
              line-height: 35px;
              letter-spacing: 0px;
              color: #fff;
              text-align: center;
              margin: 0 auto;
            }
          }
          position: relative;
        }
        .payBox {
          margin-right: 15px;
        }
        .payBox:nth-child(4) {
          // margin-right: 0;
        }
        .payBox.active {
          background-color: #ffffff;
          border: solid 2.8px var(--van-button-primary-background);
        }
        .payBox.active::after {
          content: "";
          display: block;
          width: 36px;
          height: 36px;
          //   background: #d6dce8;
          background-image: url("@/assets/images/common/dui.png");
          background-size: cover;
          background-position: 0px 0px;
          position: absolute;
          top: -1px;
          right: 0;
        }
      }
    }
    .sellButton {
      display: block;
      margin: 0 auto;
      margin-top: 32px;
      width: 668.8px;
      height: 79.9px;
      background-color: var(--van-button-primary-background);
      border-radius: 6.9px;

      line-height: 79.9px;
      font-family: MicrosoftYaHei;
      font-size: 30.6px;
      font-weight: normal;
      font-stretch: normal;
      letter-spacing: 0px;
      color: #ffffff;
      z-index: 11;
    }
