    padding: 20px 0;
    line-height: 50.9px;
    font-family: MicrosoftYaHei;
    font-size: 30.6px;
    font-weight: normal;
    font-stretch: normal;
    letter-spacing: 0px;
    color: #7a818e;
    text-align: center;
    .left,
    .right {
      width: 50%;
    }
    i {
      font-size: 35px;
    }
  }
