      border-radius: 15.28px;
      text-align: center;
      line-height: 89.58px;
      border: solid 2.08px #edf2f7;
    }
    .box.active {
      background-color: #edf2f7;
    }
  }
  .text_sell {
    position: relative;
    margin-top: 5px;
    padding: 20px;
    color: #878e98;
    font-size: 26px;
    line-height: 42px;
    z-index: 11;
    .title_t {
      font-size: 35px;
      line-height: 50px;
    }
  }
  .m_top {
    font-size: 27.78px;
    color: #13161b;
  }
  .wrap_dow {
    .text {
      position: relative;
      display: block;
      width: 25%;
    }
    .right_shu {
      width: 0.5px;
      height: 40%;
      position: absolute;
      right: 0;
      top: 30%;
      background: #d7d6d6;
    }
  }
}

.confirm-dialog {
  &__content {
    text-align: center;
    margin-top: 60px;
    h4 {
      margin-top: 35px;
      font-family: MicrosoftYaHei-Bold;
      font-size: 49px;
      font-weight: 600;
      font-stretch: normal;
      line-height: 33px;
      letter-spacing: 0px;
      color: #13161b;
      span {
        font-family: MicrosoftYaHei;
        font-size: 49px;
        font-weight: normal;
        font-stretch: normal;
        line-height: 33px;
        letter-spacing: 0px;
        color: #868d9a;
      }
    }
  }
  .van-dialog__footer {
    display: none;
  }

  &__form {
    padding: 20px 40px;
    &-item {
      text-align: left;
    }
    &-btn {
      margin-top: 30px;
    }
    label {
      font-size: 24px;
      text-align: left;
    }

    :deep(.van-field) {
      padding: 0 0.26667rem;
      height: 1.01333rem;
      background-color: #ebf1f6;
      border-radius: 0.09333rem;
      margin-top: 30px;
      .van-field__control {
        line-height: 76px;
        font-family: MicrosoftYaHei;
        font-size: 35px;
        font-weight: normal;
        font-stretch: normal;
        letter-spacing: 0px;
        color: #13161b;
      }
    }
  }

  .icon-close {
    position: absolute;
    right: 40px;
    top: 24px;
  }
}

:deep(.dialog-deal) {
  width: 708px;
  height: auto;
  padding: 40px;
  .van-dialog__header {
    padding: 0;
    font-size: 29px;
    color: #13161b;
  }
  .van-dialog__content {
    margin: 33px 0 35px 0;
    font-size: 25px;
    color: #787f8c;
    text-align: justify;
  }

  .van-dialog__footer {
    padding: 0;
  }

  .van-dialog__confirm,
  .btn-confirm {
    width: 100%;
    height: 80px;
    font-size: 31px;
    background: var(--van-button-primary-background);
    color: #fff;
    border: 0;
    border-radius: 8px;
  }

  .dialog-radio-controler {
    margin-top: 20px;

    .radio {
      margin-right: 10px;
    }

    .radio-uncheck {
      width: 35px;
      height: 35px;
      border: 1px solid #868d9a;
      border-radius: 50%;
    }
    .radio-text {
      font-size: 25px;
      color: #13161b;
    }
  }
  .icon-close {
    position: absolute;
    right: 40px;
    top: 24px;
  }

  img {
    width: 100%;

    &.verifi-id {
      width: 260px;
    }

    &.add-card {
      width: 295px;
    }
  }
  .content {
    width: 380px;
    margin-top: 24px;
    background: transparent;
  }
}

